import { useEffect, useState } from "react";
import { results } from "./services";

export default function Results() {
    const [data, setData] = useState({});

    useEffect(() => {
        results().then(setData);
    }, []);

    return (
        <div>
            <h3>Results</h3>
            {Object.keys(data).map(k => (
                <p key={k}>{k} : {data[k]}</p>
            ))}
        </div>
    );
}
